function Title() {
  return (
    <header className="main-header">
          <nav>
              <a href="">View</a>
      </nav>
      <style jsx>{`
        .main-header {
          display: flex;
          color: green;
          font-size: 16px;
        }
      `}</style>
    </header>
  );
}
export default Title;
